  \"2016-07-27T22:42:01.193865\",\n\t\"name\": \"environmental-contaminants-in-potential-prey-of-aplomado-falcons-in-the-lower-rio-grande-v\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Reintroduction of the northern aplomado
  falcon (Falco femoralis septentrionalis) into its former range in Texas began in
  1985, and continued with a full scale release of captive-bred falcons in 1993 on
  Laguna Atascosa National Wildlife Refuge (NWR). A study was conducted in 1994 to
  determine whether contaminants in falcon prey posed a threat to the successful recovery
  of the species. Meadowlark (Sturnella sp.), mourning dove (Zenaida macroura), cicadas,
  and dragonflies were collected from two areas on the Laguna Atascosa NWR and from
  two tracts on the Lower Rio Grande Valley NWR where falcons may disperse. Organophosphate
  pesticides and PAH's were below detection levels in all samples. With the exception
  of DDE, all other organochlorine pesticides were also below detection. Mercury concentrations
  in meadowlark were above levels in prey that have been associated with reproductive
  anomalies in sensitive aquatic birds, so there may be some concern about reproductive
  or chronic effects in the aplomado falcon from this heavy metal.\",\n\t\"license_title\":
